import React from 'react';
import { Link } from 'react-router-dom';
import './NavBar.css'; 

export default function Footer() {
  return (
    <nav>
      <Link to="/">בית</Link>
      <Link to="/items">דגלים</Link>
      <Link to="/about">אודות</Link>
    </nav>
  );
}
